import React,{useState,useEffect} from 'react'
import { useNavigate,useSearchParams }  from "react-router-dom";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { useSelector, useDispatch } from 'react-redux'
import axios from 'axios';
axios.defaults.withCredentials = true


const Thankyou = ()=>{

  const [searchParams] = useSearchParams();
  const [checkoutData,  setCheckoutData] = useState(['']);

  const auth  = useSelector((state) => state.loginRes.userId);
  const API_BASE_URL = process.env.REACT_APP_API_BASE_URL
  //console.log(API_BASE_URL)

  useEffect(()=>{

    axios("http://localhost:2000/payment/get-order", {
      method: "post",
      data:{sessionId:searchParams.get('session_id')},
      //withCredentials: true
    }).then(function (result) {
        result = result.data
       if(result.status == true){
          setCheckoutData(result.msg);
        }else{

            toast.warning(result.msg, {
            position: toast.POSITION.TOP_RIGHT,
          });
        }
    });

  },[])





  return (

           <div className="register_div">

                      <div className="justify-center items-center h-screen  text-gray-900">
                        <div className="rounded-md relative  p-3 ">
                          <div className="py-2">
                            <div className="text-center text-xl font-bold text-white">ORDER</div>
                            <div className="text-center text-xs font-bold text-white">The order details</div>
                          </div>
                          <div className="text-center text-xs font-bold mb-1">~~~~~~~~~~~~~~~~~~~~~~~~~~~~</div>
                          <div className="text-xs pl-2">
                            <div className="text-xs mb-1 text-white">Customer：Jack</div>
                            <div className="text-xs mb-1 text-white">TelePhone：182****8888</div>
                            <div className="text-white">OrderNumber：17485554487748500</div>
                          </div>
                          <div className="border-double border-t-4 border-b-4 border-l-0 border-r-0 border-white-900 my-3">
                            <div className="flex text-sm pt-1 px-1">
                              <span className="w-2/6 text-white">Name</span>
                              <span className="w-2/6 text-right text-white">Price</span>
                              <span className="w-2/6 text-right text-white">Number</span>
                            </div>
                            <div className="border-dashed border-t border-b border-l-0 border-r-0 border-whit-900 mt-1 my-2 py-2 px-1">
                              <div className="flex justify-between text-sm">
                                <span className="w-2/6 truncate text-white">Gym suit</span>
                                <span className="w-2/6 text-right text-white">$9998</span>
                                <span className="w-2/6 text-right text-white">1</span>
                              </div>
                              <div className="flex justify-between text-sm">
                                <span className="w-2/6 truncate text-white">Boxing glove</span>
                                <span className="w-2/6 text-right text-white">$9998</span>
                                <span className="w-2/6 text-right text-white">1</span>
                              </div>
                              <div className="flex justify-between text-sm">
                                <span className="w-2/6 truncate text-white">Purified water</span>
                                <span className="w-2/6 text-right text-white">$2</span>
                                <span className="w-2/6 text-right text-white">4</span>
                              </div>
                            </div>
                          </div>
                          <div className="text-xs">
                            <div className="mb-1 text-white">Discount：￥50</div>
                            <div className="mb-52 text-white">Remark：--</div>
                            <div className="text-right">
                              <div className="text-white">Time：2020-12-21</div>
                              <div className="font-bold text-sm text-white">Aggregate：￥700</div>
                            </div>
                          </div>
                        </div>
                      </div>
              </div>
        )

}

export default Thankyou
